	(1, 'Kadiri Logistk Cargo', 'KadiriLogistikCargo@gmail.com', '082261110369', '1550057831-delivery_truck.png', '1549727255-logo2.png', 'KADIRI LOGISTIK CARGO', '1546074136-delivery.png', 'SELAMAT DATANG DI WEBSITE RESMI KAMI', 'PT KADIRI LOGISTIK CARGO adalah jasa pengiriman barang via udara-darat-laut express', 'Jl. Raya Kediri - Pare, Dadapan, Sumberejo, Ngasem, Kediri, Jawa Timur 64182', '<p>Dear client, untuk data cabang surabaya sudah dapat di inputkan, tapi untuk pengoprasian cabang surabaya masih butuh waktu</p><p><strong>NB :</strong> untuk mengganti pengumumman buka setting lalu edit field pengumuman</p>', '<p>Pengiriman minimal 11 kg</p><p>Apabila berat paket ringan akan dikenakan perhitungan volume Panjang x Lebar x Tinggi : 6000</p><p>Tarif diatas belum termasuk biaya dokumen (SMU), Karantina ( untuk tumbuhan dan hewan), Asuransi.</p><p>Tarif dapat berubah sewaktu-waktu</p><p> </p>', '<p>Area Kalimantan,Sulawesi,Indonesia bagaian timur minimal berat pengiriman 30kg,50kg,100kg</p><p>Apabila berat paket ringan akan dikenakan perhitungan volume Panjang x Lebar x Tinggi : 4000</p><p>Tarif diatas belum termasuk biaya packing bila di perlukan</p><p>Tarif dapat berubah sewaktu-waktu</p><p> </p>', '<p>Area Pulau Jawa, Madura minimal berat pengiriman 25KG</p><p>Area Sumatera, Riau, Bali, dan NTB minimal berat pengiriman 30KG</p><p>Apabila berat paket ringan akan dikenakan perhitungan volume Panjang x Lebar x Tinggi : 4000</p><p>Tarif diatas belum termasuk biaya packing bila diperlukan</p><p>Tarif dapat berubah sewaktu-waktu</p><p> </p><p> </p><p> </p>', '<p>Pengiriman minimal 1 kg</p><p>Apabila berat paket ringan akan di kenakan perhitungan volume Panjang x Lebar xTinggi : 4000</p><p>Tarif diatas belum termasuk biaya packing bila di perlukan</p><p>Tarif di atas dapat berubah sewaktu-waktu</p>', 'Y', 9);
